import React from 'react'
import { AppBar,Toolbar, Typography } from '@mui/material';

const header = () => {
  return (
    <AppBar>
        <Toolbar>
            <Typography>New Logo</Typography>
        </Toolbar>
    </AppBar>
  )
}

export default header
